import { useEffect, useContext } from "react"
import React from 'react'
import { Context } from "../Context"

export default function Tests() {
  var num = [{
    name: 'ГОВНО'
  },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },
  { name: 'МОЧА' },

  { name: 'МОЧА' },
  { name: 'МОЧА' },

  ]
  const { setCurrentPage } = useContext(Context)
  useEffect(() => setCurrentPage('/tests'), [])
  return (
    <div>
      <select name="select" onChange={num}>
        {num.map(function (n) {
          return (<option value={num.name} selected={num.name}>{num.name}</option>);
        })}
      </select>
    </div>
  )
}
